Just wanted to take this moment to thank all my followers for following my journey on social media. This page has evolved into something more than I ever expected it to be and something I‚Äôve become really proud of. I work hard to provide you guys a true insight into the life of a doctor mom as well as yummy recipes, educations, motivation and inspiration. ‚Å£
‚Å£
I started this page to inspire med students to take control of their health and wellness and to find something they enjoy to help deal with stress which for me was cooking. I thought if I shared my recipes and my story than more med students would value their wellbeing during medical training. Now after becoming a mom and physician, I‚Äôve taken this to a new level of inspiring and motivating all levels of training to take value in their wellbeing. Also sharing the ups and downs of motherhood as a resident. Sharing my love for family medicine and my tips and tricks I‚Äôve learned so far on the way. ‚Å£
‚Å£
So thank you all. Without you guys I wouldn‚Äôt have made it to 10k. Without you curiosity and questions to inspire more topics. Thank you to the community here and the amazing pages I‚Äôve connected with over the years. Please head to my stories to check out some awesome growing pages. ‚Å£
‚Å£
And remember, we are better when we support each other and uplift each other. ‚Å£
