Being grateful will help you stay happy, not just for the things you have but the people around you. Who knowingly or unknowingly help you to keep your life straight, some for a short period of time, some for lifelong. Your gesture will make them happy too. So don't hesitate to say "Thank You" :)

Being hopeful will always keep you positive even in the darkest night. You might not get what you always wanted but better than you anticipated as most of the times we don't even know that what we want is really what we need? And when we get what we actually needed, we think "Yes! It's good I didn't get what I believed that I want". Let life surprise you, it might disappoint you at times but you will get what you deserve when the time is right. Till then stay hopeful :)

